import React, { Component } from "react";
import Header from "../../components/NutritionLabelComponents/Header/Header";
import Nutrients from "../../components/NutritionLabelComponents/Nutrients/Nutrients";
import Vitamins from "../../components/NutritionLabelComponents/Vitamins/Vitamins";
import Styles from "./NutritionLabel.module.css";

class NutritionLabel extends Component {
    state = {
        itemsList: [
            {
            nutrition:null,
            name: "Cheese",
            amount:{    
                amount:100,
                units:"grams"
                }
            },
            {
            nutrition:null,
            name: "Salt",
            amount:{   
                amount:2,
                units:["spoon","spoons"]
                }
            },
            {
            nutrition:null,
            name: "Egg",
            amount: {
                amount:1,
                units:null
                }
            }
        ]
    } 
    render(){
        return(
            <div>
                <Header servingSize="100 g"/>
                <Nutrients>
                    <ul>
                        <li>
                            <b className={Styles.Attribute}>Total Fat</b>
                            <ul>
                                <li></li>
                                <li></li>
                            </ul>
                        </li>
                        <li>
                            <b className={Styles.Attribute}>Cholesterol</b>
                        </li>
                        <li>
                            <b className={Styles.Attribute}>Sodium</b>
                        </li>
                        <li>
                            <b className={Styles.Attribute}>Total Carbohydrates</b>
                            <ul>
                                <li></li>
                                <li></li>
                            </ul>
                        </li>
                        <li>
                            <b className={Styles.Attribute}>Protein</b>
                        </li>
                    </ul>
                </Nutrients>
                <Vitamins collection={[
                    [`Vitamin A ${10}%`, `Vitamin C ${20}%`],
                    [`Calcium ${30}%`, `Iron ${40}%`]
                ]}/>
            </div>
        )
    }
}

export default NutritionLabel;
